INSERT INTO `articles` VALUES ('1601816917007', '冒泡排序', 'Oxygen', '1635552844@qq.com', '1.时间复杂度\r\n冒泡排序是一种交换排序，是从数组中选取第一个数，和其他数字做比较，如果所选取的数字大于\r\n其\r\n他的数字，就做交换，时间复杂度最好的情况是O(n)，这种就是只经历一轮比较就得出准确的结\r\n果，最坏的情况是O(n2)\r\n![](http://localhost:8080/resources/upload/pic/chai.png)\r\n稳定性分析\r\n冒泡排序就是把小的元素往前调或者把大的元素往后调。比较是相邻的两个元素比较，交换也发生\r\n在这两个元素之间。如果两个元素相等，那么不会进行交换，所以冒泡排序是稳定的排序算法。\r\n\r\n冒泡排序算法改进\r\n冒泡排序是每个数字向后沉，只确定了最大值，可以在每次循环之中进行正反两次冒泡，分别找到\r\n最大值和最小值，如此可使排序的轮数减少一半。提升效率，这里只指出思路，可以尝试写下，啦\r\n啦啦。', '2020-10-04', NULL, 'Java、算法', '算法', '原创', '排序的时间复杂度分析', NULL, '1', '1', NULL);
