INSERT INTO `articles` VALUES ('1603007738153', '通俗理解卷积神经网络', 'Oxygen', '1635552844@qq.com', '神经网络由大量的神经元相互连接而成。每个神经元接受线性组合的输入后，最开始只是简单的线\r\n性\r\n加权，后来给每个神经元加上了非线性的激活函数，从而进行非线性变换后输出。每两个神经元之\r\n间\r\n的连接代表加权值，称之为权重（weight）。不同的权重和激活函数，则会导致神经网络不同的输\r\n出。\r\n\r\n   举个手写识别的例子，给定一个未知数字，让神经网络识别是什么数字。此时的神经网络的输入\r\n由一组被输入图像的像素所激活的输入神经元所定义。在通过非线性激活函数进行非线性变换后，\r\n神\r\n经元被激活然后被传递到其他神经元。重复这一过程，直到最后一个输出神经元被激活。从而识别\r\n当前数字是什么字。', '2020-10-18', NULL, '科学    ', '默认', '原创', '神经网络由大量的神经元相互连接而成', NULL, '0', '1', NULL);
INSERT INTO `articles` VALUES ('1603029616573', 'Beats：使用 Elastic Stack 记录 Golang 应用日志', 'Dpprz', '1223788353@qq.com', '当今可用的丰富编程语言为程序员提供了用于构建应用程序的大量工具。无论是像 Java 这样的老\r\n牌巨头\r\n样的新兴公语言，应用程序都需要在部署后进行监视。在本文中，你将学习如何将Golang日志发送\r\n到ELK Stack和Logz.io。\r\n通常可以通过查看其日志来了解应用程序的运行状况。但是，日志数据具有随时间呈指数增长的趋\r\n势。当更多应用程序部署并分布在多台服务器上时，尤其如此。 Elastic Stack 具有存储大量数\r\n据并快速，轻松地进行搜索的功能，在这里很方便。', '2020-10-18', NULL, 'Be    ', '程序人生', '原创', 'Be', NULL, '0', '0', NULL);
